# Função para converter as linhas
def convert_line(line):
    # Remove aspas simples em torno de números e substitui vírgulas por pontos
    converted_line = re.sub(r"'(\d+),(\d+)'", r"\1.\2", line)  # Altera 'x,y' para x.y
    converted_line = re.sub(r"'(NULL)'", r"NULL", converted_line)  # Mantém NULL como está
    return converted_line

# Converte todas as linhas
converted_data = [convert_line(line) for line in data_lines]

# Exibe as linhas convertidas com uma quebra de linha no final
for converted_line in converted_data:
    print(converted_line + "\n")